package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * yw_game_type  * @author  *  */public class YwGameType implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 类别名称	 */	private String name;	/**	 * 排序	 */	private Integer orderId;	/**	 * 状态(0删除1开启2禁用)	 */	private String status;	/**	 * 创建时间	 */	private Date createTime;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置类别名称	 */	 public void setName(String name){	 	this.name = name;	 }	 	 /**	  * 获取类别名称	  */	 public String getName(){	 	return this.name;	 }	/**	 * 设置排序	 */	 public void setOrderId(Integer orderId){	 	this.orderId = orderId;	 }	 	 /**	  * 获取排序	  */	 public Integer getOrderId(){	 	return this.orderId;	 }	/**	 * 设置创建时间	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取创建时间	  */	 public Date getCreateTime(){	 	return this.createTime;	 }	public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}}